import Education from "./Education";
const cards = [
    { box: "box", h5: "B.E.",p:"I am pursuing my Bachelor's Degree in Information Science & Engineering at", href:"https://geethashishu.in", college: "GSSSIETW", place: ", Mysure.", p1: "Year:", year: "2019-2023", p2:"CGPA:", cgpa:"8.54"},
    { box: "box", h5: "12th State.",p:"I have complete my 12th std from", href:"https://deekshalearning.com/college/mahalakshmipuram-bengaluru/", college: "KMWA PU College", place: ", (Deeksha Campus) Bangalore.", p1: "Year:", year: "2019", p2:"Percentage", cgpa:"82.50"},
    { box: "box", h5: "10th ICSE",p:"I have completed my 10th std from", href:"https://www.gangainstitution.com", college: "Ganga International School", place: ", Bengaluru.", p1: "Year:", year: "2017", p2:"Percentage", cgpa:"87.40"}
]
const EducationCards = ()=>{
    return (<div>
        <Education cards={cards}/>
    </div> 
    );
}
export default EducationCards;

